import React from "react";
import { Helmet } from "react-helmet";

function Home() {
  return (
    <div>
      <Helmet>
        <title>Privacy policy analyzer</title>
      </Helmet>
      <h1>Test</h1>
    </div>
  );
}

export default Home;
